<!DOCTYPE html>
<html>
  <head>
    <meta charset="UTF-8">
    <title>LaTeX GitHub Markdown</title>

    <link rel="stylesheet" href="./assets/frameworks-bedfc518345498ab3204d330c1727cde7e733526a09cd7df6867f6a231565091.css">
    <link rel="stylesheet" href="./assets/github-c59588b2c3ff53c653475dbf1b1a0511c6bad346dbe35e17d1d52c3f9e5f2991.css">
    <link rel="stylesheet" href="render.css">
  </head>
  <body>
    <!-- Render -->
    <div class="container">
      <div id="render">
        <div id="github-head"></div>
        <div class="file">
          <div id="readme" class="readme blob instapaper_body">
            <article class="markdown-body entry-content">
            </article>
          </div>
        </div>
      </div>
      <script src="jquery.min.js"></script>
      <script src="render.js"></script>
      <script src="html_1.js"></script>
      <script type="text/x-mathjax-config">
        MathJax.Hub.Config({
          tex2jax: {
            inlineMath: [['$','$'], ['$$','$$']],
            displayMath: []
          }
        });
        MathJax.Hub.Queue(
          function () {
            if (parent.postMessage) {
              parent.postMessage(document.body.offsetHeight, '*');
            }
          }
        );
      </script>
    </div>

    <!-- Google Analytics -->
    <script>
      (function(i,s,o,g,r,a,m){i['GoogleAnalyticsObject']=r;i[r]=i[r]||function(){
      (i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),
      m=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)
      })(window,document,'script','https://www.google-analytics.com/analytics.js','ga');
      ga('create', 'UA-82074308-1', 'auto');
      ga('send', 'pageview');
    </script>
  </body>
</html>
